  input: '"TEXT","F3A","","The FEC recently sent a letter to the campaign asking why
    the receipts and expenditures are higher in the amended pre-primary report than
    they were in the original pre-primary report.  While there are some small amounts
    of receipts and dispursements that were updated, improved, and cleaned up, the
    vast majority of the difference can be explained by an error made by staff in
    entering a $150,000 loan made by the candidate into the correct format in NGP.  The
    amount, loaned to the campaign, showed up as a loan, but not as money that had
    been recorded on NGP as a receipt.  This is the major difference in the net numbers
    . The other factor, frankly, in why the numbers in the amended report are vastly
    superior is that, unintentionally, staff members were somewhat sloppy in their
    summarizing of data.  With the addition of new personnel later in the campaign,
    this problem was eliminated, and a high priority was placed on tracking data in
